import { makeStyles } from '@mui/styles';

export default makeStyles((theme) => ({
  sidebar: {
    height: '100%',
    width: '35%',
    position: 'absolute',
    top: '0',
    left: '0',
    transition: 'transform 0.5s ease-in-out'
  },
  imageHolder: {
    height: '100%',
    width: '100%',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    color: '#fff',
  },
  detailSlider: {
    height: '100%',
  position: 'absolute',
  top: '0',
  left: '35%',
  width: '65%',
  transition: 'transform 0.5s ease-in-out',
  }
}))
